              alignSelf="center" 
            /> */}
          </div>
        </div>
      </div>
      <div>
        <button 
          // color="dark-1" 
          // label="Try again" 
          // onClick={toggleUi} 
        />
      </div>
    </div>
  )
}

export default choiceView;
